@mixin onMobile {
  @media (min-width: 0) and (max-width: 768px) {
    @content;
  }
}

@mixin onTablet {
  @media (min-width: 768px) {
    @content;
  }
}

@mixin onLaptop {
  @media (min-width: 1280px) {
