    @include onLaptop {
      line-height: 27px;
    }

    &:hover {
      @include onTablet {
        color: $colorGrey;
      }
    }

    &--active {
      color: $colorGrey;

      &::after {
        opacity: 1;
      }
    }
  }

  &__container {
    position: relative;
    margin-bottom: 20px;

    @include onLaptop {
      margin-bottom: 45px;
    }

    @include onDesktop {
      margin-bottom: 40px;
    }
  }

  &__button {
    padding: 0 20px;

    @include onTablet {
      width: max-content;
      margin: 0 auto;
      padding: 0;
    }
  }

  &__top-actions {
    display: block;

    @include onLaptop {
      display: grid;
    }
  }
}

