sources.styles\\blocks\\footer.scss:
.footer {
  padding: 30px 0 60px;

  background-color: #8c9772;

  @include onLaptop {
    padding: 60px 0 65px;
  }

  &__list {
    list-style: none;

    @include onLaptop {
      display: flex;
    }
  }

  &__list-item {
    margin-bottom: 20px;

    @include onLaptop {
      margin: 0 40px 0 0;

      &:last-child {
        margin: 0;
      }
    }
  }

  &__link {
    position: relative;
    color: $colorBeige;

    &::after {
      background-color: $colorBeige;
    }

    @include onLaptop {
      font-size: 18px;
      line-height: 23px;
      font-weight: 500;
    }
  }

  &__icons {
    display: flex;
    align-items: center;
    margin-bottom: 30px;

    @include onTablet {
      margin-bottom: 56px;
    }

    @include onLaptop {
      margin-bottom: 0;
    }
  }

  &__icon {
    &:first-child {
      margin-right: 20px;

      @include onLaptop {
        margin-right: 15px;
      }
    }
  }

  &__contacts {
    margin-bottom: 30px;

    @include onTablet {
      margin-bottom: 0;
    }

    @include onLaptop {
      margin-bottom: 30px;
    }
  }

  &__contacts-item {
    margin-bottom: 12px;
    padding-top: 3px;
    font-size: 14px;
    line-height: 18px;
    color: $colorBeige;

    &:last-child {
      margin-bottom: 0;
    }

    @include onLaptop {
      margin-bottom: 20px;
      padding: 0;
      font-size: 18px;
      line-height: 23px;
      font-weight: 500;
    }
  }

  &__contacts-phone {
    margin-bottom: 20px;
  }

  &__contacts-time {
    display: block;
  }

  &__copyrights {
    width: 80%;
    margin: 0 auto;

    font-family: "Sharp Sans Display No2", sans-serif;
    font-size: 14px;
    line-height: 18px;
    text-align: center;
    color: $colorBeige;
    text-transform: uppercase;

    @include onTablet {
      width: 100%;
      margin: 0;
      text-align: left;
      text-transform: lowercase;
    }

    @include onLaptop {
      font-size: 16px;
      line-height: 23px;
      text-transform: uppercase;
    }
  }

  &__copyrights-item {
    display: none;

    @include onLaptop {
      display: inline;
      text-transform: capitalize;
    }
  }
}
